DROP TABLE IF EXISTS Detections;
DROP TABLE IF EXISTS Servers;
DROP TABLE IF EXISTS Classes;
DROP TABLE IF EXISTS Pics;
DROP TABLE IF EXISTS Account;
CREATE TABLE Account(id INTEGER NOT NULL primary key autoincrement,
Email	VARCHAR(254) NOT NULL,
Name	VARCHAR(254) NOT NULL,
Password	VARCHAR(254) NOT NULL,
Userrole	VARCHAR(25) NOT NULL);
CREATE TABLE Detections(id INTEGER NOT NULL primary key autoincrement,
Picid	INTEGER,
Classid	INTEGER,
XMin	REAL,
YMin	REAL,
XMax	REAL,
YMax	REAL,
Confidence	REAL);
CREATE TABLE Servers(id INTEGER NOT NULL primary key autoincrement,
Url	VARCHAR(39),
Model	VARCHAR(13));
CREATE TABLE Classes(id INTEGER NOT NULL primary key autoincrement,
Classname	VARCHAR(16),
Grp	VARCHAR(12),
Catagory	VARCHAR(7),
Active	INTEGER,
Replacewith	VARCHAR(8));
CREATE TABLE Pics(id INTEGER NOT NULL primary key autoincrement,
Filename	VARCHAR(55),
Night	INTEGER,
Path	VARCHAR(26),
Catagory	VARCHAR(6),
Grp	VARCHAR(7),
Classname	VARCHAR(12));
